 стать клиентом и торговать с ними на брокере Esperio. И говорит, что нет времени отсрачивать решение. Сделали крипто кошелёк, зарегистрировались на Esperio. Нужна была большая сумма около 5000 долларов для получения бонуса. Взял кредит и ещё со вклада. \r\nПотом курсы «школа трейдинга» всего ушло 120000. И в сумма моего депозита стала 13000. Потом аккуратной торговлей заработал в сумме 38000 долларов. А потом с «финансовым аналитиком» экспертом опираясь на его профессионализм мы установили торгового робота. На 4 валютные пары. Робот работал один день нормально. А на следующий т открыл огромные объёмы по усреднению своих убыточных сделок. При том, что вместе с «экспертом» мы открыли убыточные сделки и он как эксперт не принял это во внимание. Когда уровень маржи дошёл до 100%, 83%. Он вместе со мной посмотрел глупым взглядом и предложил ждать. Так когда уровень дошёл до 35%, тоже. А потом наступил песец и автозакрытие с минусом. В беседе, он ссылался, что у нас просто не хватило маржи. Он не принимал вину и переводил на меня. Моих сделок там почти не было. Забавно. Я бы уж точно не слился так тупо. Что интересно, мани мененджмент и риск менеджмент мы ни в первом курсе, ни во втором школы брокера не прорабатывали. Что способствует убытку. Они постоянно показывали свои демосчета, реального ни разу не увидел. Потом выяснилось, что оказывается страховку, которую мы с финансовым экспертом другим не сделали. Тут тоже обвинили меня, что я затупил. Со мной занимался человек с 5 летним стажем. Тоже странно. Мы сделали и всё было нормально, но по ходу дела там люди абсолютно не имеют в этом компетенции. Постоянно просят по бонусам вложить ещё большую сумму на депозит, всё время мелкие недочёты и недомолвки. Потерял всё. И ко мне потеряли интерес. Почти. Сейчас хотят, чтобы положил ещё 7000 долларов. Говорят можно использовать кредит. Так я и повёлся. Тупо слили деньги. Тем более, что даже не сам своими сделками. Очень жаль, что так получилось, но зато плохой опыт тоже опыт. В